INSERT INTO `announcements` (`id`, `announcement`) VALUES
(1, '<!--\n	<span style="font-size:16px;"><span style="color: rgb(0, 128, 128); "><span style="background-color: rgb(240, 255, 255); ">Time to Say goodbye to the starving artist mentality!!! </span></span></span>There is a <a href="/gymsignup/MoneySeminar.htm" target="_new">Money Seminar</a> coming to the gym on August 9th. <a href="/gymsignup/MoneySeminar.htm" target="_new">Click here</a> to learn more.</p>\n<p>\n-->\n<p>\n	<span class="Apple-style-span" style="font-size: 14px; ">TO JOIN AN AERIAL CLASS: contact Sarah Romanowsky, sarahromanowsky@yahoo.com, 415-271-7463 or Jena Carpenter 818-653, 5629.</span></p>\n<p>\n	<span style="color:#b22222;"><strong><span style="font-size:16px;">Inquiries about Focus Fish Classes:  Kristy <span class="Apple-style-span" style="font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 23px; "><strong style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-size: 14px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; font-weight: bold; ">323-691-5747, </strong></span> <span class="Apple-style-span" style="font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: 23px; "><strong style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-size: 14px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; font-weight: bold; background-position: initial initial; background-repeat: initial initial; "><a href="http://focusfish.com/contact-us/" style="margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 0px; border-left-width: 0px; border-style: initial; border-color: initial; outline-width: 0px; outline-style: initial; outline-color: initial; font-size: 14px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: transparent; color: rgb(228, 120, 51); text-decoration: none; background-position: initial initial; background-repeat: initial initial; " title="email us">info@focusfish.com</a>, http://focusfish.com/</strong></span></span></strong></span></p>\n<p>\n	<span style="font-size:14px;"><span style="color: blue; "><span style="color: rgb(75, 0, 130); "><strong>To reserve 100% of the gym</strong> for a private session, please contact Jeri</span></span><span class="Apple-style-span" style="color: rgb(75, 0, 130); "> for rates and availability</span><span class="Apple-style-span" style="color: blue; "><span style="color: rgb(75, 0, 130); "><span class="Apple-style-span" style="font-weight: normal; ">: 661-713-3141 or </span></span><span class="Apple-style-span" style="color: rgb(75, 0, 130); font-weight: normal; ">jeri@kalvan.net. </span></span><span style="color: rgb(75, 0, 130); font-weight: normal; ">If you have booked 100% before, you may book the space, then please notify Jeri of the date and time. </span></span></p>\n<h2>\n	<span style="font-size:16px;"><span style="color: rgb(255, 0, 0); "><span class="Apple-style-span" style="font-weight: normal; ">*** Please cancel your gym reservations asap if you are not going to be here. </span></span></span></h2>\n<p>\n	<span style="font-size:14px;"><span style="font-size:16px;"><span style="color: rgb(255, 0, 0); "><span style="color: rgb(0, 0, 0); "><span class="Apple-style-span" style="font-weight: normal; "><strong>PARKING:  </strong></span></span></span></span><span class="Apple-style-span" style="font-weight: normal; ">1. If possible, please park in front of our house.  2. Leave room so others can park in front of or behind you. (Don''t take up 2 spaces!)  <span class="Apple-style-span" style="">3. Our <strong>neighbor across the street</strong> </span>would prefer you<strong> <u>not park in front of her house</u></strong></span> during the daytime as it shades her front yard garden. <span style="color: rgb(128, 0, 128); "><strong> </strong></span><br />\n	</span></p>\n<p>\n	<span style="font-size:14px;"><br />\n	</span></p>\n<h3 style="color: blue;">\n	<strong style="color: rgb(128, 0, 128); ">Thank You. We love you</strong><span style="color: rgb(128, 0, 128); ">!</span></h3>\n<p>\n	<span _fck_bookmark="1" style="display: none; "> </span></p>\n'),
(2, '<p>\n	Hello test</p>\n');
